import request from '@/utils/request'

const baseUrl = `/log/order/order`

export default {
    pageFind(page, limit) {  // 分页查看当前正在执行的订单信息
        return request({
            url: `${baseUrl}/listOrder/${page}/${limit}`,
            method: 'get'
        })
    },

    orderDetailsById(id) {
        return request({
            url: `${baseUrl}/`
        })
    }
}
